import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
	intro: {
		textAlign: "center",
	},
	image: {
		textAlign: "center",
		padding: "2rem 0",
	},
	about: {
		marginTop: "6rem",
	},
	story: {
		padding: "2rem 0",
	},
	principles: {
		display: "grid",
		gridTemplateColumns: "repeat(2, 1fr)",
		gridGap: "2rem",
	},
	contact: {
		display: "flex",
		flexDirection: "column",
		alignItems: "center",
		justifyContent: "center",
		textAlign: "center",
		height: "20vh",
		backgroundColor: "#f39c12",
		color: "#17202a",
		marginBottom: "4rem",
	},
}));
